        Dictionary<string, long> memo = new Dictionary<string, long>();
        private int[] minPossibleFromIndex;
        private int[] maxPossibleFromIndex;
        [Theory(DisplayName = "3333. Find the Original Typed String II")]
        [InlineData("aabbccdd", 7, 5)]
        [InlineData("aabbccdd", 8, 1)]
        [InlineData("aaabbb", 3, 8)]
        [InlineData("ere", 1, 1)]
        [InlineData("aaaaaaaaagggyqgrdddddddvvvvvvtttttttttuuuuuuuuuunnnnsssssiiiiiiiiitttttuuuv", 16, 275562000)]
        [InlineData("ggggggggaaaaallsssssaaaaaaaaaiiqqqqqqqqqqbbbbbbbvvfffffjjjjeeeeeefffmmiiiix", 34, 834168507)]
        [InlineData("aaafffffeeeeoooooobbbbbbbbggghhhhhhheeeeeeewwwwwwwwiiiiiiiijjjjjjjjaaaannnnnnniiiiiiimmmmmmmmrrrrrrrriieeeiiiiiiyyyybbbbbbbbbbbbbbbbbbbbzzzzeelllllllliiippppmmmmmmmmmmuuuuuuunnnnnnnnzzzzzzzzzzijjjjvvb", 118, 297466760)]
        [InlineData("", 1365, 676224483)]
        [InlineData("", 1292, 101346905)]
        [InlineData("", 1658, 360478606)]
        public void Test3333(string word, int k, int expected)
        {
            List<int> groups = new List<int>();

            int currentCount = 1;
            for (int i = 1; i < word.Length; i++)
            {
                if (word[i] == word[i - 1])
                    currentCount++;
                else
                {
                    groups.Add(currentCount);
                    currentCount = 1;
                }
            }
            groups.Add(currentCount);

            int[] nums = groups.ToArray();
            //PrecomputeMinMaxSums(nums);
            //long result = Test3333_recursive(nums, k, 0, 0);

            long MOD = ((long)Math.Pow(10, 9)) + 7L;

            int maxPossibleSum = nums.Sum();

            long[] dp = new long[maxPossibleSum + 1];

            dp[0] = 1;
            foreach(long maxValue in nums)
            {
                for(long currentSum = maxPossibleSum; currentSum >= 0; currentSum--)
                {
                    if (dp[currentSum] == 0)
                        continue;

                    for(int num = 1; num <= maxValue; num++)
                        if(currentSum + num <= maxPossibleSum)
                            dp[currentSum + num] += dp[currentSum] % MOD;
                    dp[currentSum] = 0;
                }
            }

            long result = 0;
            for (int i = k; i <= maxPossibleSum; i++)
            {
                result += dp[i];
            }

            Assert.Equal(expected, result % MOD);
        }

        private void PrecomputeMinMaxSums(int[] nums)
        {
            int length = nums.Length;
            minPossibleFromIndex = new int[length + 1];
            maxPossibleFromIndex = new int[length + 1];

            for(int i = length - 1; i >= 0; i--)
            {
                minPossibleFromIndex[i] = minPossibleFromIndex[i + 1] + 1;
                maxPossibleFromIndex[i] = maxPossibleFromIndex[i + 1] + nums[i];
            }
        }

        private long Test3333_recursive(int[] nums, int k, int idx, int currentSum)
        {
            long MOD = ((long)Math.Pow(10, 9)) + 7L;

            if (idx == nums.Length)
                return currentSum >= k ? 1 : 0;

            if(currentSum + maxPossibleFromIndex[idx] < k)
            {
                return 0;
            }

            if(currentSum + minPossibleFromIndex[idx] >= k)
            {
                long rs = 1;
                for(int i = idx; i < nums.Length; i++)
                {
                    rs = (rs * nums[i]) % MOD;
                }
                return rs;
            }

            string key = $"{idx}_{currentSum}";
            if (memo.ContainsKey(key))
            {
                return memo[key];
            }

            long count = 0;
            for(int i = 1; i <= nums[idx]; i++)
            {
                count = (count + Test3333_recursive(nums, k, idx + 1, currentSum + i)) % MOD;
            }
            
            memo[key] = count;
            return count;
        }


        [Theory(DisplayName = "3330. Find the Original Typed String I")]
        [InlineData("abbcccc", 5)]
        [InlineData("abbccccdddddd", 10)]
        [InlineData("abcd", 1)]
        [InlineData("aaaa", 4)]
        [InlineData("ere", 1)]
        public void Test3330(string word, int expected)
        {
            int result = 0;

            int charGroupDupleCount = 0;
            int lastDupleCharIdx = 0;
            for (int i = 1; i < word.Length; i++)
            {
                if (word[i] == word[lastDupleCharIdx])
                    charGroupDupleCount++;
                else
                    lastDupleCharIdx = i;
            }

            result = charGroupDupleCount + 1;

            Assert.Equal(expected, result);
        }

        [Theory(DisplayName = "1. Two Sum")]
        [InlineData(new int[] { 2, 7, 11, 15 }, 9, new int[] { 0, 1 })]
        [InlineData(new int[] { 3, 2, 4 }, 6, new int[] { 1, 2 })]
        [InlineData(new int[] { 3, 3 }, 6, new int[] { 0, 1 })]
        [InlineData(new int[] { 3, 2, 3 }, 6, new int[] { 0, 2 })]
        [InlineData(new int[] { -1, -2, -3, -4, -5 }, -8, new int[] { 2, 4 })]
        [InlineData(new int[] { 3, 2, 95, 4, -3 }, 92, new int[] { 2, 4 })]
        public void Test1(int[] nums, int target, int[] expected)
        {
            int[] result = [99, 99];

            //for (int i = 0; i < nums.Length; i++)
            //{
            //    for (int j = i + 1; j < nums.Length; j++)
            //    {
            //        if (nums[i] + nums[j] == target)
            //        {
            //            result = [i, j];
            //        }
            //    }
            //}

            Dictionary<int, List<int>> indexNumMap = new Dictionary<int, List<int>>();
            for (int i = 0; i < nums.Length; i++)
            {
                bool isCanGet = indexNumMap.TryGetValue(nums[i], out List<int> indexies);
                if (isCanGet)
                    indexies.Add(i);
                else
                    indexNumMap.Add(nums[i], new List<int>() { i });
            }

            foreach (int num in indexNumMap.Keys)
            {
                int subValue = target - num;

                if (indexNumMap.ContainsKey(subValue))
                {
                    int firstIndex = indexNumMap[num].First();

                    foreach(int val in indexNumMap[subValue])
                    {
                        if(val != firstIndex)
                        {
                            result = [firstIndex, val];
                            break;
                        }
                    }
                }
            }
            Array.Sort(result);
            Assert.Equal(expected, result);
        }

        [Theory(DisplayName = "594. Longest Harmonious Subsequence")]
        [InlineData(new int[] { 1, 3, 2, 2, 5, 2, 3, 7 }, 5)]
        [InlineData(new int[] { 1, 2, 3, 4 }, 2)]
        [InlineData(new int[] { 1, 1, 1, 1 }, 0)]
        [InlineData(new int[] { 0, 7, 9, 9, 3, 5, 4, 3, 2, 3, 3, 9, 0, 4, 5, 1, 0, 10, 5, 5, 4, 9, -5, 2, 6, 5, 9, 5, 1, 6, 6, 7, 9, 5, 2, 1, 0, 7, 2, 9, 7, 4, 7, 9, 3, 6, 9, 2, 10, 9, 1, 7, 8, 8, 8, 7, 4, 2, 7, 9, -4, 3, 0, 6, 3, 8, 3, 0, 9, 4, 6, 10, 1, 6, 10, 0, 2, 3, 2, 7, 9, 8 }, 18)]
        public void Test594(int[] nums, int expected)
        {
            Dictionary<int, int> numCount = new Dictionary<int, int>();

            for(int i= 0; i < nums.Length; i++)
            {
                bool canGetNumFromNumCount = numCount.TryGetValue(nums[i], out int countValue);
                if (canGetNumFromNumCount)
                    numCount[nums[i]] = countValue + 1;
                else
                    numCount.Add(nums[i], 1);
            }

            int maxValue = 0;
            foreach(int num in numCount.Keys)
            {
                int value = numCount[num];

                bool canGetValue = numCount.TryGetValue(num + 1, out int nextValue);
                if(canGetValue && value + nextValue > maxValue)
                    maxValue = value + nextValue;

                canGetValue = numCount.TryGetValue(num - 1, out int prevValue);
                if (canGetValue && value + prevValue > maxValue)
                    maxValue = value + prevValue;
            }
            

            int result = maxValue;
            Assert.Equal(expected, result);
        }
    }
